import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

const Dashboard = () => {
  const [performanceData, setPerformanceData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Fetch performance trends
    axios.get('http://localhost:8000/api/analytics/performance-trends')
      .then(response => {
        const data = response.data?.trends || [];
        setPerformanceData(Array.isArray(data) ? data : []);
        setLoading(false);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
        // Set mock data as fallback
        setPerformanceData([
          {"semester": "Fall 2022", "average_gpa": 3.1, "attendance_rate": 85},
          {"semester": "Spring 2023", "average_gpa": 3.2, "attendance_rate": 87},
          {"semester": "Fall 2023", "average_gpa": 3.3, "attendance_rate": 89},
          {"semester": "Spring 2024", "average_gpa": 3.2, "attendance_rate": 86},
          {"semester": "Fall 2024", "average_gpa": 3.4, "attendance_rate": 91},
          {"semester": "Spring 2025", "average_gpa": 3.3, "attendance_rate": 88}
        ]);
        setLoading(false);
      });
  }, []);

  if (loading) {
    return (
      <div className="container mx-auto p-6">
        <h1 className="text-3xl font-bold mb-6">Student Performance Dashboard</h1>
        <div className="text-center">Loading...</div>
      </div>
    );
  }

  return (
    <div className="container mx-auto p-6">
      <h1 className="text-3xl font-bold mb-6">Student Performance Dashboard</h1>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6 mb-8">
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-2">Total Students</h2>
          <p className="text-3xl font-bold text-blue-600">1,247</p>
        </div>
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-2">At-Risk Students</h2>
          <p className="text-3xl font-bold text-red-600">156</p>
        </div>
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold mb-2">Average GPA</h2>
          <p className="text-3xl font-bold text-green-600">3.2</p>
        </div>
      </div>

      <div className="bg-white p-6 rounded-lg shadow-md">
        <h2 className="text-xl font-semibold mb-4">Performance Trends</h2>
        <ResponsiveContainer width="100%" height={400}>
          <LineChart data={performanceData}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="semester" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Line type="monotone" dataKey="average_gpa" stroke="#8884d8" name="Average GPA" />
            <Line type="monotone" dataKey="attendance_rate" stroke="#82ca9d" name="Attendance Rate (%)" />
          </LineChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
};

export default Dashboard;
